webpackJsonp([73287900011234],{799:function(n,o){n.exports={data:{markdownRemark:{frontmatter:{title:"TEREM",type:"lyrics"},html:"<h1>TEREM</h1>\n<section>\n<p>Vremja govorilo so mnoj na japonskom,<br>\nSzhimalo menja v ieroglif ono.</p>\n<p>Vremja pokazalo mne, kak ostavat'sja ploskim,<br>\nNo ja neposlushnyj smatyvalsja veretenom.</p>\n<p>Tjanetsja put'<br>\nmechenoj ten'ju,<br>\nja ishhu terem,<br>\nsposobnyj obut'.</p>\n<p>Mne kazalos', ja — jeto tol'ko namjoki,<br>\nProstye motivy, chuzhie slova.</p>\n<p>No doroga govorila mne, chto v liven' my ne<br>\nnamoknem.<br>\nVoda barabanit o ruki moi — zhernova.</p>\n<p>Tjanetsja put'<br>\nmechenoj ten'ju,<br>\nja ishhu terem, sposobnyj obut'.</p>\n<p>Vremja pokazalo mne dvenadcat' udarov,<br>\nno ja ne pochuvstvoval ni odnogo.</p>\n<p>Ja vypal v okno, podrazhaja Ikaru — <br>\npod kozhej moej per'jami drozhalo steklo.</p>\n<p>teplitsja vremja<br>\nput' moj naruchnik<br>\nsvetit skvoz' noch' mne<br>\nbroshennyj terem<br>\nterem dom<br>\nterem kotoryj<br>\nsposoben obut'<br>\nja kradus' vorom<br>\nbojus' vzdohnut'</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/terem/"}}}});
